import React, { useState } from 'react';
import axios from 'axios';

const ItineraryCreationForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({
    title: '',
    destination: '',
    dates: '',
    participantLimit: 1,
    vibeTags: [],
    description: '',
    budget: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleTagAdd = (e) => {
    if (e.key === 'Enter' && e.target.value) {
      setFormData({
        ...formData,
        vibeTags: [...formData.vibeTags, e.target.value],
      });
      e.target.value = '';
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const itineraryData = {
      title: formData.title,
      destination: formData.destination,
      dates: formData.dates,
      participantLimit: parseInt(formData.participantLimit, 10),
      vibeTags: formData.vibeTags,
      description: formData.description,
      budget: formData.budget,
      timestamp: new Date().toISOString(),
    };
    try {
      await axios.post('http://localhost:5000/api/itineraries', itineraryData, {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` },
      });
      onSubmit(itineraryData);
      setFormData({
        title: '',
        destination: '',
        dates: '',
        participantLimit: 1,
        vibeTags: [],
        description: '',
        budget: '',
      });
    } catch (error) {
      console.error('Error posting itinerary:', error);
    }
  };

  return (
    <div className="max-w-lg mx-auto p-4 bg-white shadow-md rounded-lg">
      <h2 className="text-xl font-semibold mb-4">Create a Group Trip</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label className="block text-sm font-medium text-gray-700">Trip Title</label>
          <input
            type="text"
            name="title"
            value={formData.title}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md"
            placeholder="e.g., Coastal Camping Adventure"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Destination</label>
          <input
            type="text"
            name="destination"
            value={formData.destination}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md"
            placeholder="e.g., Big Sur, CA"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Travel Dates</label>
          <input
            type="text"
            name="dates"
            value={formData.dates}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md"
            placeholder="e.g., July 10-12, 2025"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Participant Limit</label>
          <input
            type="number"
            name="participantLimit"
            value={formData.participantLimit}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md"
            min="1"
            max="50"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Vibe Tags</label>
          <input
            type="text"
            onKeyDown={handleTagAdd}
            className="mt-1 p-2 w-full border rounded-md"
            placeholder="e.g., adventure, budget, music (press Enter to add)"
          />
          <div className="mt-2 flex flex-wrap gap-2">
            {formData.vibeTags.map((tag, index) => (
              <span key={index} className="bg-blue-200 text-blue-800 px-2 py-1 rounded">
                {tag}
              </span>
            ))}
          </div>
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Description</label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md resize-none"
            placeholder="Describe the trip (e.g., hiking, beach days)"
            rows="4"
            required
          />
        </div>
        <div>
          <label className="block text-sm font-medium text-gray-700">Estimated Budget</label>
          <input
            type="text"
            name="budget"
            value={formData.budget}
            onChange={handleChange}
            className="mt-1 p-2 w-full border rounded-md"
            placeholder="e.g., $200 per person"
          />
        </div>
        <button
          type="submit"
          className="w-full bg-blue-500 text-white p-2 rounded-md hover:bg-blue-600"
        >
          Post Itinerary
        </button>
      </form>
    </div>
  );
};

export default ItineraryCreationForm;
